import { createAction } from '@reduxjs/toolkit';

const dataloaded = createAction("DATA_LOADED")

// const initialState={
//     userinfo:[]
// }

function reducer(state={},action){
    switch (action.type) {
        case dataloaded:
            return { ...state, userinfo: action.userinfo}
        default:
            return state
    }
  
}
export default reducer;
